script: |
  super -f text -I q11447.spq | sort > q11447.out

inputs:
  - name: q11447.spq
    data: |
      SELECT - - 92 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( - col1 + 22 + + - col1 ) BETWEEN col0 AND col1 * col0 * + 54;
  - name: tab2

outputs:
  - name: q11447.out
    data: |
      92
      92
      92
